import React from 'react'
import {
    Dialog,
    DialogTitle,
} from '@material-ui/core'

export default function AddFixedCostDialog(props) {
    return (
        <div>
            <Dialog
                open={props.open}
                onClose={props.onClose}
            >
                <DialogTitle>Add a fixed cost</DialogTitle>
            </Dialog>
        </div>
    )
}
